class ZooplaScraper:

    xpath_property_card = {"class": "listing-results clearfix js-gtm-list"}
    xpath_total_results = {"class": "listing-results-utils-count"}

    def __init__(self):
        self.base_url = "https://www.zoopla.co.uk"
        self.search_url = self.base_url + "/search/"
        self.prop_page_url = self.base_url + "/to-rent/details/"
        self.search_type = "to-rent"
        self.results_page_size = 100
        self.include_retirement_home = False
        self.include_rented = False
        self.results = []

    def search(self, search_postcode: str, **kwargs):
        summary_url = self.base_url + self._get_summary_url(search_postcode, **kwargs)
        iteration_count = math.ceil(self._get_total_results(summary_url) / self.results_page_size)
        self._get_properties_summary(summary_url, pn=iteration_count)
        print(len(self.results))
        print(self.results)
        self._parse_property_profile(self.results[0])
        return self.results

    def _get_summary_url(self, search_postcode: str, **kwargs):
        headers = {
            'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) '
                          'Chrome/60.0.3112.113 Safari/537.36'
        }

        payload = {
            "q": search_postcode,
            "include_retirement_homes": self.include_retirement_home,
            "include_rented": self.include_rented,
            "section": self.search_type,
            "page_size": self.results_page_size,
            "price_max": kwargs["price_max"] if "price_max" in kwargs else None,
            "radius": kwargs["radius"] if "radius" in kwargs else None
        }

        r = requests.get(self.search_url, headers=headers, params=payload, allow_redirects=False)

        if r.status_code == 301:
            return r.headers['Location']

    def _get_total_results(self, summary_url):
        headers = {
            'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) '
                          'Chrome/60.0.3112.113 Safari/537.36'
        }

        data = requests.get(summary_url, headers=headers)

        if data.status_code == 200:
            soup = BeautifulSoup(data.text, "html.parser")
            total_results = int((soup.find("span", self.xpath_total_results))
                                .contents[0]
                                .replace(' ', '')
                                .split('of')[1])
            return total_results

    def _get_properties_summary(self, summary_url, **kwargs):
        headers = {
            'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) '
                          'Chrome/60.0.3112.113 Safari/537.36'
        }
        iteration_count = kwargs['pn'] if 'pn' in kwargs else None

        payload = {
            "pn": iteration_count
        }

        if iteration_count == 0:
            return
        else:
            data = requests.get(summary_url, headers=headers, params=payload)
            print(data.url)
            if data.status_code == 200:
                soup = BeautifulSoup(data.text, "html.parser")
                self._parse_properties_summary(soup)
                iteration_count -= 1
                self._get_properties_summary(summary_url, pn=iteration_count)

    def _parse_properties_summary(self, soup):
        properties_soup = soup.find("ul", self.xpath_property_card)
        for prop in properties_soup.contents:
            try:
                self.results.append(self.prop_page_url + prop.attrs["data-listing-id"])
            except (AttributeError, KeyError):
                pass

    def _parse_property_profile(self, prop_profile_url: str):
        data = requests.get(prop_profile_url)
        if data.status_code == 200:
            soup = BeautifulSoup(data.text, "html.parser")
            js_scripts_soup = soup.find_all('script')
            relevant_js_scripts = []
